import React from 'react';
import './Menu.modules.css';

import shiro from './shiro.png';
import akame from './akame.png';
import logo_calendar from './logo_calendar.png';

export default class Menu extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div id="m_container">
                <div>
                    <div>
                        <h1 id='m_title_text_border'>React Sandbox</h1>
                        <h1 id='m_title_text' className='m_text_gradient'>React Sandbox</h1>
                    </div>
                    
                    <div id='m_title_img_container'>
                        <img src={shiro} alt='shiro' id='m_title_img'/>
                        {/* <div class='shadow'></div> */}
                    </div>
                    <h1 id='m_dash' className='m_text_gradient'>-</h1>
                </div>
                <div id='m_buttonss'>
                    <div id='m_button_grid'>
                        <button className='m_button' onClick={() => this.props.handleDisplayChange(1)}>
                            <img src={akame} className='m_button_img'/>
                            <h1 className='m_button_text'>Image Collage</h1>
                            <h1 className='m_button_arrow'>&#8250;</h1>
                        </button>
                        <button className='m_button' onClick={() => this.props.handleDisplayChange(2)}>
                            <img src={logo_calendar} className='m_button_img'/>
                            <h1 className='m_button_text'>Calendar</h1>
                            <h1 className='m_button_arrow'>&#8250;</h1>
                        </button>
                        <button className='m_button'>

                        </button>
                    </div>
                </div>
            </div>
        )
    }
}
